    public static int lengthOfLongestSubstring(String s) {
        int stringLength = s.length();

        if (stringLength == 0 || stringLength == 1) {
            return stringLength;
        }

        int startWindow = 0;
        int endWindow = 0;

        int currentMaxLength = 0;
        String currentMaxString = "";

        boolean noDuplicates;

        Map<Character, Integer> charSet = new HashMap<>();

        for (; startWindow < stringLength; charSet.remove(s.charAt(startWindow)), startWindow++) {
            while (endWindow < stringLength) {
                char currentChar = s.charAt(endWindow);
                noDuplicates = !charSet.containsKey(currentChar);
                if (noDuplicates) {
                    charSet.put(currentChar, endWindow);
                } else {
                    // If there are duplicates, we know that endWindow is above it's normal value by just one
                    break;
                }
                endWindow++;
            }

            int potentialNewMaxSize = charSet.size();
            if (potentialNewMaxSize > currentMaxLength) {
                currentMaxLength = potentialNewMaxSize;
                // endWindow is already greater by 1 than it's normal value
                currentMaxString = s.substring(startWindow, endWindow);
                System.out.println("A new maximum was found: " + currentMaxString);
            }
            System.out.println("The Set contains these elements: ");
            charSet.forEach((key, value) -> System.out.println(key + ": " + value));
        }


        System.out.printf("The answer is \"%s\", with the length of %d.%n", currentMaxString, currentMaxLength);
        return currentMaxLength;
    }
